The default configuration acts as a caching server. Simply uncomment and edit /etc/bind/named.conf.options to set the IP addresses of your ISP's DNS servers: forwarders { 1.2.3.4; 5.6.7.8;
}; Replace 1.2.3.4 and 5.6.7.8 with the IP Addresses of actual nameservers (e.g 8.8.8.8, 8.8.4.4). Save and close the file. Then test the config file syntax: sudo named-checkconf If the test is successful (indicated by a silent output), then restart BIND9: sudo systemctl restart named If you have UFW firewall running on the BIND server, then you need to open port 53 to allow LAN clients to send DNS queries: sudo ufw allow domain To turn query logging on, run: sudo rndc querylog on This will open TCP and UDP port 53 to the private network 192.168.0.0/24. Then from another computer in the same LAN, we can run the following command to query the A record of google.com. Replace 192.168.0.102 with the IP address of your BIND resolver: dig A google.com @192.168.0.102 Now on the BIND resolver, check the query log with the following command: sudo journalctl -eu named This will show the latest log message of the bind9 service unit. You should fine something like the following line in the log, which indicates that a DNS query for google.com's A record has been received from port 57806 of 192.168.0.103: named[1162]: client @0x7f4d2406f0f0 192.168.0.103#57806 (google.com): query: google.com IN A +E(0)K (192.168.0.102) Another way of testing your configuration is to use dig against the loopback interface to make sure it is listening on port 53. From a terminal prompt: dig -x 127.0.0.1 You should see lines similar to the following in the command output: ;; Query time: 1 msec
;; SERVER: 192.168.1.10#53(192.168.1.10) If you have configured BIND9 as a Caching nameserver “dig” an outside domain to check the query time: dig ubuntu.com Note the query time towards the end of the command output: ;; Query time: 49 msec After a second dig there should be improvement: ;; Query time: 1 msec

